import "./CostFilter.css";

const CostFilter = () => {
  const yearChangeHundler = (event) => {
    console.log("yearChangeHundler ", event.target.value);
    onChangeYear(event.target.value);
  };
  return (
    <div className="filter__container">
      <div>Filter</div>
      <div>
        <select onChange={yearChangeHundler}>
          <option>2021</option>
          <option>2022</option>
          <option>2023</option>
          <option>2024</option>
        </select>
      </div>
    </div>
  );
};

export default CostFilter;
